// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwBaseSublocation2 from 'viewmodel/AwBaseSublocation2ViewModel';
import AwSidenav from 'viewmodel/AwSidenavViewModel';
import AwStandardWorkarea from 'viewmodel/AwStandardWorkareaViewModel';
import AwServerVisibilityCommandBar from 'viewmodel/AwServerVisibilityCommandBarViewModel';
import AwFooter from 'viewmodel/AwFooterViewModel';
import { ExistWhen,AwClass } from 'js/hocCollection';
const AwBaseSublocation2ExistWhen = ExistWhen(AwBaseSublocation2);
const AwSidenavExistWhen = ExistWhen(AwSidenav);
const MainAwClass = AwClass('main');
const NavExistWhen = ExistWhen('nav');
const AwFooterExistWhen = ExistWhen(AwFooter);



/*
ctx imports
*/
import { getStdContext as context } from 'js/awDefaultSublocationService';
const ctxImportObj = { context };


/*
dynamic import
 */
registerDynImportEntry('js/AwStandardSublocationService', () => import('js/AwStandardSublocationService'));
registerDynImportEntry('js/awDefaultSublocationService', () => import('js/awDefaultSublocationService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "sideNavLeftData": {
            "slide": "FLOAT",
            "direction": "RIGHT_TO_LEFT",
            "animation": false,
            "width": "STANDARD",
            "height": "FULL"
        },
        "sideNavRightData": {
            "slide": "PUSH",
            "direction": "LEFT_TO_RIGHT",
            "animation": false,
            "width": "STANDARD",
            "height": "FULL"
        }
    },
    "props": {
        "provider": {
            "type": "object"
        },
        "base-selection": {
            "type": "object"
        },
        "search-state": {
            "type": "object"
        },
        "sub-panel-context": {
            "type": "object"
        },
        "selection-model": {
            "type": "object"
        },
        "selection-data": {
            "type": "object"
        },
        "sublocation-state": {
            "type": "object"
        }
    },
    "actions": {
        "initializeStandardSublocation": {
            "actionType": "JSFunction",
            "method": "initializeStandardSublocation",
            "inputData": {
                "provider": "{{props.provider}}"
            },
            "outputData": {
                "sublocationStyles": ""
            },
            "deps": "js/AwStandardSublocationService"
        },
        "cleanUp": {
            "actionType": "JSFunction",
            "method": "cleanUp",
            "deps": "js/awDefaultSublocationService"
        }
    },
    "ctx": {
        "mselected": null,
        "pselected": null,
        "context": {
            "parser": {
                "method": "getStdContext",
                "deps": "js/awDefaultSublocationService"
            }
        }
    },
    "lifecycleHooks": {
        "onMount": "initializeStandardSublocation",
        "onUnmount": "cleanUp"
    },
    "i18n": {
        "rightHandToolBar": [
            "UIElementsMessages"
        ]
    },
    "_viewModelId": "AwStandardSublocationInternal",
    "_uniqueViewModelId": "AwStandardSublocationInternal"
};

/*
<aw-base-sublocation2 exist-when="props.provider" provider="props.provider" base-selection="props.baseSelection"
    selection-data="props.selectionData">
    <div class='aw-layout-defaultSublocation aw-layout-flexColumn'>
        <div class='aw-layout-sublocationContainer'>
            <!-- pass state as a subpanelcontext to aw-sidenav. "...props.searchState" is kept temp and to avoid breaking change. -->
            <!-- Once AWC changes are done, this would be removed-->
            <aw-sidenav id='aw_navigation' config="data.sideNavRightData"
                sub-panel-context='{...props.subPanelContext, selectionData:props.selectionData, baseSelection: props.baseSelection, searchState: props.searchState, pageContext: {...props.subPanelContext.pageContext, secondaryActiveTabId: props.sublocationState.secondaryActiveTabId !== "" ? props.sublocationState.secondaryActiveTabId : undefined, sublocationState: props.sublocationState}}'
                exist-when='!props.provider.awSubLocationPref.hideNavigationArea'>
            </aw-sidenav>
            <div class='aw-layout-workarea'>
                <div class='aw-layout-flexbox'>
                    <main
                        aw-class="['aw-layout-workareaMain',{'vertical': data.sublocationStyles.vertical},{'vertical-reverse': data.sublocationStyles.verticalReverse},{'horizontal-reverse': data.sublocationStyles.horizontalReverse}]">
                        <aw-standard-workarea base-selection="props.baseSelection"
                            selection-model="props.selectionModel" selection-data="props.selectionData"
                            sub-panel-context='props.ctx.context[0]'
                            search-state="props.searchState"
                            is-horizontal-orientation="props.provider.awSubLocationPref.orientation==='HORIZONTAL'">
                        </aw-standard-workarea>
                    </main>
                    <aw-sidenav id='aw_toolsAndInfo' config="data.sideNavLeftData"
                        sub-panel-context='{...props.subPanelContext,selectionData: props.selectionData, baseSelection: props.baseSelection, searchState: props.searchState, pageContext:{...props.subPanelContext.pageContext, secondaryActiveTabId: props.sublocationState.secondaryActiveTabId !== "" ? props.sublocationState.secondaryActiveTabId : undefined, sublocationState: props.sublocationState}}'
                        exist-when='!props.provider.awSubLocationPref || !props.provider.awSubLocationPref.hideToolsAndInfoArea'>
                    </aw-sidenav>
                </div>
            </div>
            <nav exist-when='!props.provider.awSubLocationPref.hideRightWall' aria-label='i18n.rightHandToolBar'
                class='aw-layout-flexCommandbar aw-layout-infoCommandbar'>
                <aw-server-visibility-command-bar
                    context='{...props.subPanelContext, searchState: props.searchState, selectionData: props.selectionData, provider: props.provider, baseSelection: props.baseSelection, pageContext:{...props.subPanelContext.pageContext, secondaryActiveTabId: props.sublocationState.secondaryActiveTabId !== "" ? props.sublocationState.secondaryActiveTabId : undefined, sublocationState: props.sublocationState}}'
                    anchor='aw_rightWall' alignment='VERTICAL' mselected='ctx.mselected' pselected='ctx.pselected'
                    class='aw-commands-nativeCommandBar aw-commands-commandBarContainer aw-commands-commandBarVertical'>
                </aw-server-visibility-command-bar>
            </nav>
        </div>
        <aw-footer class="afx-accent-background aw-footer-container" exist-when='!props.subLocationPreference.hideFooter' anchor="aw_footer" include-global="includeGlobalCommands"></aw-footer>
    </div>
</aw-base-sublocation2>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <AwBaseSublocation2ExistWhen provider={AwParseService.instance( "props.provider" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} baseSelection={AwParseService.instance( "props.baseSelection" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} selectionData={AwParseService.instance( "props.selectionData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} existWhen={AwParseService.instance( "props.provider" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
        <div className="aw-layout-defaultSublocation aw-layout-flexColumn">
            <div className="aw-layout-sublocationContainer">
                <AwSidenavExistWhen id="aw_navigation" config={AwParseService.instance( "data.sideNavRightData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} subPanelContext={AwParseService.instance( "{...props.subPanelContext, selectionData:props.selectionData, baseSelection: props.baseSelection, searchState: props.searchState, pageContext: {...props.subPanelContext.pageContext, secondaryActiveTabId: props.sublocationState.secondaryActiveTabId !== \"\" ? props.sublocationState.secondaryActiveTabId : undefined, sublocationState: props.sublocationState}}" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} existWhen={AwParseService.instance( "!props.provider.awSubLocationPref.hideNavigationArea" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                </AwSidenavExistWhen>
                <div className="aw-layout-workarea">
                    <div className="aw-layout-flexbox">
                        <MainAwClass awClass={AwParseService.instance( "['aw-layout-workareaMain',{'vertical': data.sublocationStyles.vertical},{'vertical-reverse': data.sublocationStyles.verticalReverse},{'horizontal-reverse': data.sublocationStyles.horizontalReverse}]" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                            <AwStandardWorkarea baseSelection={AwParseService.instance( "props.baseSelection" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} selectionModel={AwParseService.instance( "props.selectionModel" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} selectionData={AwParseService.instance( "props.selectionData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} subPanelContext={AwParseService.instance( "props.ctx.context[0]" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} searchState={AwParseService.instance( "props.searchState" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} isHorizontalOrientation={AwParseService.instance( "props.provider.awSubLocationPref.orientation==='HORIZONTAL'" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                            </AwStandardWorkarea>
                        </MainAwClass>
                        <AwSidenavExistWhen id="aw_toolsAndInfo" config={AwParseService.instance( "data.sideNavLeftData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} subPanelContext={AwParseService.instance( "{...props.subPanelContext,selectionData: props.selectionData, baseSelection: props.baseSelection, searchState: props.searchState, pageContext:{...props.subPanelContext.pageContext, secondaryActiveTabId: props.sublocationState.secondaryActiveTabId !== \"\" ? props.sublocationState.secondaryActiveTabId : undefined, sublocationState: props.sublocationState}}" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} existWhen={AwParseService.instance( "!props.provider.awSubLocationPref || !props.provider.awSubLocationPref.hideToolsAndInfoArea" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                        </AwSidenavExistWhen>
                    </div>
                </div>
                <NavExistWhen aria-label={i18n.rightHandToolBar} className="aw-layout-flexCommandbar aw-layout-infoCommandbar" existWhen={AwParseService.instance( "!props.provider.awSubLocationPref.hideRightWall" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                    <AwServerVisibilityCommandBar context={AwParseService.instance( "{...props.subPanelContext, searchState: props.searchState, selectionData: props.selectionData, provider: props.provider, baseSelection: props.baseSelection, pageContext:{...props.subPanelContext.pageContext, secondaryActiveTabId: props.sublocationState.secondaryActiveTabId !== \"\" ? props.sublocationState.secondaryActiveTabId : undefined, sublocationState: props.sublocationState}}" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} anchor="aw_rightWall" alignment="VERTICAL" mselected={AwParseService.instance( "ctx.mselected" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} pselected={AwParseService.instance( "ctx.pselected" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} className="aw-commands-nativeCommandBar aw-commands-commandBarContainer aw-commands-commandBarVertical">
                    </AwServerVisibilityCommandBar>
                </NavExistWhen>
            </div>
            <AwFooterExistWhen className="afx-accent-background aw-footer-container" anchor="aw_footer" include-global="includeGlobalCommands" existWhen={AwParseService.instance( "!props.subLocationPreference.hideFooter" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwFooterExistWhen>
        </div>
    </AwBaseSublocation2ExistWhen>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
